import React from "react";
import "./scss/style.scss";

const fetchData = (message: string) => {
  fetch(`https://nethergames.de:1763/check?message=${message}render=true`).then(
    (res) => {
      return res;
    }
  );
};

const App = () => {
  return (
    <div className="container">
      <div className="container__text">
        <textarea className="container__input"></textarea>
      </div>
      <div onClick={() => {fetchData("test")}} className="container__button">
        Button
      </div>
    </div>
  );
};

export default App;
